import React, { useState} from 'react'

function CreateUser() {
  const [username, setUsername] = useState('')

  function onChangeUsername(e) {
    const { value } = e.target
    setUsername(value)
  }

  function onSubmit(e) {
    e.preventDefault()

    const newUser = {
      username: username
    }

    console.log(newUser)

    setUsername('')
  }

  return (
    <div>
      <h1>Create User</h1>
    </div>
  )
}

export default CreateUser
